import {
  Select,
  SelectContent,
  SelectTrigger,
  SelectValue,
} from "@/registry/default/ui/select";

export default function SelectDemo() {
  return (
    <Select>
      <SelectTrigger>
        <SelectValue placeholder="yawa" />
      </SelectTrigger>
      <SelectContent></SelectContent>
    </Select>
  );
}
